export default class Student {
  name : string;
  id: Number;
  school: string;
  email: string;
  interests: Array<string>;

  constructor(name : string, id: number, school: string, email: string, interests: Array<string>) {
    this.name = name;
    this.id = id;
    this.school = school;
    this.email = email;
    this.interests = interests;
  }

  // Method
  getId() {
    return this.id;
  }
}
